BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "grupo_videocurso" (
	"id"	INTEGER NOT NULL UNIQUE,
	"titulo"	TEXT NOT NULL,
	"created_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	"updated_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	"deleted_at"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "video_curso" (
	"id"	INTEGER NOT NULL UNIQUE,
	"titulo"	varchar(150) NOT NULL,
	"descricao"	varchar(150),
	"url"	varchar(200) NOT NULL,
	"imagem"	varchar(200),
	"video_id"	varchar(15),
	"playlist_id"	varchar(100),
	"tamanho_min"	varchar(10),
	"tamanho_ms"	varchar(10),
	"id_grupo"	integer,
	"created_at"	TEXT NOT NULL DEFAULT CURRENT_TIMESTAMP,
	"updated_at"	TEXT,
	"deleted_at"	TEXT,
	"codigo"	TEXT(100),
	FOREIGN KEY("id_grupo") REFERENCES "grupo_videocurso"("id") ON DELETE SET NULL ON UPDATE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);




COMMIT;
